import React, { useEffect, useState } from "react";

function App() {
  const [apiStatus, setApiStatus] = useState("Loading...");

  useEffect(() => {
    // Replace with your backend API URL set in .env
    const apiBaseUrl = process.env.REACT_APP_API_BASE_URL || "http://localhost:4000/api";

    fetch(`${apiBaseUrl}/status`)
      .then((response) => {
        if (!response.ok) throw new Error("Network response was not ok.");
        return response.json();
      })
      .then((data) => setApiStatus(data.status))
      .catch(() => setApiStatus("API unreachable"));
  }, []);

  return (
    <div style={{ padding: 20 }}>
      <h1>Resume RAG Frontend</h1>
      <p>Backend API Status: {apiStatus}</p>
    </div>
  );
}

export default App;
